function FAQs() {
    return (
        <div className='container p-4 mt-5'>
            <h3>FAQs</h3>
            <div className='border-top'>
                <h4>What is ProfitProfile account?</h4>
                <p></p>
            </div>
        </div>
    )
}

export default FAQs;
